@everyone **Missing Semester Workshop #2 on 'Debugging' coming to you this Wednesday (tomorrow/Oct 11th) at 4pm, in SELE 2260 (CS Lounge). **You all are smack in the middle of the Fall 2023 semester and all the seg faults must be getting to you, naturally. Join us as we help you through the most common errors people make while debugging and get you in shape for your next CS project! See you tomorrow at 4!
RSVP here (+ snacks included!): https://forms.gle/eRgcw78X848bM18Q7\

